import logo from "./logo.svg";
import "./App.css";
import MainPage from "./components/mainpage";
import PageOne from "./components/pageone";
import { LiquidSwipe } from "./components/liquidswipe.js";
import dataJson from "./components/data.json";
function App() {
  var components = [];
  var components_data = [];
  for (let i = 0; i < dataJson.length; i++) {
    components.push(
      <MainPage
        title={dataJson[i]["title"]}
        sub_title={dataJson[i]["sub_title"]}
        description={dataJson[i]["description"]}
        backgroundColor={dataJson[i]["theme"][0]}
      />
    );
  }

  components.push(<PageOne />);
  components.push(<PageOne />);
  var components1 = [];
  console.log(dataJson[0]["theme"][0]);
  var colors = [];
  colors.push("#fff");
  colors.push("#871003");
  colors.push("#E7B996");

  return (
    <div className="App">
      <LiquidSwipe components={components} colors={colors} />
    </div>
  );
}

export default App;
